package hackerRank.algorithms

object HashTablesRansomNote {
  def main(args: Array[String]) {
    val sc = new java.util.Scanner (System.in)
    val m = sc.nextInt()
    val n = sc.nextInt()
    val magazine = new Array[String](m)
    for(magazine_i <- 0 until m) {
      magazine(magazine_i) = sc.next()
    }
    val ransom = new Array[String](n)
    for(ransom_i <- 0 until n) {
      ransom(ransom_i) = sc.next()
    }

    println(if (ransom.forall(message => magazine.contains(message))) "Yes" else "No")
  }
}


